import React from 'react';
import 'materialize-css/dist/css/materialize.min.css';
import 'materialize-css/dist/js/materialize.min.js';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { HashRouter } from 'react-router-dom';
import Home from './components/pages/Home';
import Skills from './components/pages/skills/Skills';
import Experiences from './components/pages/experiences/Experiences';
import Educations from './components/pages/educations/Educations';
import Portfolios from './components/pages/portfolios/Portfolios';
import './App.css';

function App() {
  return (
    <Router>
      <>
        <HashRouter exact path="/" component={Home} />
        <Switch>
          <HashRouter path="/skills" component={Skills} />
          <HashRouter path="/experiences" component={Experiences} />
          <HashRouter path="/educations" component={Educations} />
          <HashRouter path="/portfolios" component={Portfolios} />
        </Switch>
      </>
    </Router>
  );
}

export default App;
